const Header = ({className, data, clients}) => {
  const {
    name, 
    navigation: {
      menus: menuItems
    }
  } = data

  return (
    <header 
      data-name={name}
      className={className ? className : 'header'} 
    >
      <div className={`${className}__wrapper`}>
        <nav className={`${className}__nav`}>

        </nav>

        <button 
          data-btn="theme" 
          data-theme="moon"
          className={`${className}__theme`}
        >
          <MoonIcon/>
        </button>

        <button 
          data-btn="burger"
          className={`${className}__burger`}
          onClick={handleBurgerButtonClick} 
        >
          <span></span>
        </button>    
      </div>
    </header>
  )
}

export default Header
